and process_generic_list name a f  =
  Ad_process_generic_list( name,  [
    (match a with
    | [] -> Ad_empty_list name
    | a :: t ->
        let v1 = f a in
        if t != [] then Ad_process_list_tail (v1 , process_generic_list_tail name t f )
        else v1)
   ])

